import { Component, OnInit } from '@angular/core';
import { ActivatedRoute } from '@angular/router';
import { NexgoSDKNew } from 'nexgsdknew';


@Component({
  selector: 'app-print',
  templateUrl: './print.page.html',
  styleUrls: ['./print.page.scss'],
})
export class PrintPage implements OnInit {
  public transaction: {
    transactionID: string;
    account: string;
    amount: string;
    balanceBefore: string;
    balanceAfter: string;
    transType: string;
    productID: string;
    product: string;
    transactionReference: string;
    externalReference: null;
    transferedBy: string;
    remarks: null;
    status: string;
    transDate: string;
    customerID: string;
    customerName: string;
    transferedByName: string;
  } = {
      transactionID: '',
      account: '',
      amount: '',
      balanceBefore: '',
      balanceAfter: '',
      transType: '',
      productID: '',
      product: '',
      transactionReference: '',
      externalReference: null,
      transferedBy: '',
      remarks: null,
      status: '',
      transDate: '',
      customerID: '',
      customerName: '',
      transferedByName: ''
    }

  constructor(
    private route: ActivatedRoute
  ) {

  }

  ngOnInit() {
    this.route.queryParams.subscribe((params) => {
      if (params['transaction']) {
        this.transaction = JSON.parse(params['transaction']);
      }
    });
  }

  async printWholeReceipt() {
    try {
      // Base64 logo image string
      const logoBase64 = '';
      // Step 1: Print the logo
      await NexgoSDKNew['printImage']({
        base64Image: logoBase64,
      });

      // Step 3: Prepare receipt content
      const receiptHeader = `\n--------------------------------\n           Receipt         \n--------------------------------\n`;
      const receiptDetails = ` Receipt ID: ${this.transaction.transactionID}\n SERVICE: ${this.transaction.product}\n DATE: ${this.transaction.transDate.slice(0, -3)}\n ACCOUNT: ${this.transaction.account}\n CONTACT: 0759552604\n AMOUNT: ${this.transaction.amount}\n CHARGES: not returned\n COMMISSION: not returned\n AMOUNT LOADED: ${this.transaction.amount} \n--------------------------------\n`;
      const receiptFooter = ` Thank you for shopping with us!`;

      // Step 4: Print the receipt text
      await NexgoSDKNew['printText']({
        text: receiptHeader + receiptDetails + receiptFooter,
        fontSize: 24,
        alignment: 'LEFT',
        bold: true,
      });

      // Step 5: Start the print process
      await NexgoSDKNew['startPrint']();
    } catch (error) {
      console.error('Printing failed:', error);
    }
  }

}
